import axios from 'axios'
import { useState } from 'react'
import { useParams, useNavigate } from 'react-router-dom';
import { useSelector, useDispatch } from 'react-redux';
import { doEditMovie } from '../redux/MoviesActions';

import Grid from "@mui/material/Grid";
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import TextField from "@mui/material/TextField";



const EditMemberComp = () => {

  const dispatch = useDispatch()
  const navigate = useNavigate();
  const { memberId } = useParams();
  const members = useSelector(state => state.MembersReducer.members);
  const member = members.find((member)=> member._id === memberId)
  const [editMember, setEditMember] = useState(member)

  return (
    <div>
      <Card sx={{ width: '50%' }}>
      <CardContent>
        <Typography sx={{ fontSize: 17 }} color="text.secondary" gutterBottom>
            Edit Member: {editMember.name} 
        </Typography>   
        <Grid container direction={"column"} spacing={3}>
        <Grid item>
                  <TextField
                    id="outlined-textarea"
                    label="Name:"
                    value={editMember.name}
                    multiline
                    name="name"
                    onChange={(e) =>
                     setEditMember({ ...editMember, name: e.target.value })
                    }
                  />
                </Grid>
                <Grid item>
                  <TextField
                    id="outlined-textarea"
                    label="Email:"
                    value={editMember.email}
                    multiline
                    name="email"
                    onChange={(e) =>
                        setEditMember({ ...editMember, email: e.target.value })
                    }
                    />
                </Grid>
                <Grid item>
                  <TextField
                    id="outlined-textarea"
                    label="City:"
                    value={editMember.city}
                    multiline
                    name="city"
                    onChange={(e) =>
                    setEditMember({ ...editMember, image: e.target.value })
                    }
                    />
                </Grid>
                </Grid>
      </CardContent>
      <CardActions>
        {/* <Button variant="contained" onClick={update}>update</Button> {' '}
        <Button variant="contained" onClick={cancel}>Cancel</Button> {' '} */}
      </CardActions>
    </Card>
    </div>
  )
}

export default EditMemberComp
